TILESIZE = 4   # grandezza in pixel di un tile
TILES_X = 256    # numero di tile sull'asse x
TILES_Y = 256    # numero di tile sull'asse y
SCREEN_WIDTH = TILES_X * TILESIZE
SCREEN_HEIGHT = TILES_Y * TILESIZE
HEIGHTMAP_MAX_VALUE = 255

BLUE = (0, 0, 255)
RED = (255, 0, 0)
GREEN = (0, 255, 0)
GREEN_1 = (0, 158, 47)
BLACK = (0, 0, 0)
WHITE = (255, 255, 255)

BEACH = (242, 215, 119)
SEA = (75, 107, 250)
GRASS = (87, 224, 74)
FOREST = (43, 145, 33)
MOUNTAIN = (166, 132, 949)
ROCK = (122, 112, 100)
ROCK_1 = (97, 88, 78)
SNOW = (206, 240, 242)

DISPLAYSURF = pygame.display.set_mode((SCREEN_WIDTH, SCREEN_HEIGHT))
DISPLAYSURF.fill(WHITE)
pygame.display.set_caption("Game")


class Map(pygame.sprite.Sprite):
    def __init__(self):
        super().__init__()
        self.tilemap = self.__scaleTilemap(TILEMAP_256x256)
        self.tilemap_x = TILES_X
        self.tilemap_y = TILES_Y
        self.tilesize = TILESIZE

    def __scaleTilemap(self, tilemap):
        # la tilemap in ingresso non sempre è compresa tra -255 e 255, quindi la riscalo
        max = np.amax(tilemap)
        min = np.amin(tilemap)

        print('max is ' + str(max))
        print('min is ' + str(min))

        x_rate = abs(HEIGHTMAP_MAX_VALUE / max)
        y_rate = abs(HEIGHTMAP_MAX_VALUE / min)

        for i in range(len(tilemap)):
            if(tilemap[i] > 0):
                tilemap[i] *= x_rate
            else:
                tilemap[i] *= y_rate

        max = np.amax(tilemap)
        min = np.amin(tilemap)

        print('now max is ' + str(max))
        print('now min is ' + str(min))

        return tilemap

    def update(self):
        pressed_keys = pygame.key.get_pressed()

    def draw(self, surface):
        for i in range(len(self.tilemap)):
            if i > 31:
                fermaui = True
            
            posx = (i % self.tilemap_x) * self.tilesize
            posy = int(i / self.tilemap_y) * self.tilesize

            value = self.tilemap[i]

            color = self.__getHeightmapColor(value)

            pygame.draw.rect(DISPLAYSURF, color, (posx, posy, self.tilesize, self.tilesize))
        
    def __getHeightmapColor(self, value):
        # Restituisce un colore in base al valore della heightmap (255)
        # HLS (HUE [0-360°], LUMINOSITY [%], SATURATION [%]) -> RGB (RED, GREEN, BLUE) | tutti i parametri rinormalizzati ad 1
        # --------------------------------------------------------------------------------------------------------------------

        if value <= -10:
            color = SEA
        elif value > -10 and value <= 0:
            color = BEACH
        elif value > 0 and value <=40:
            color = GRASS
        elif value > 40 and value <=120:
            color = FOREST
        elif value > 120 and value <= 180:
            color = ROCK
        elif value > 180 and value <= 210:
            color = ROCK_1
        else:
            color = SNOW
        # else:
        #     c = colorsys.hls_to_rgb(127/255, value/255, 0.5)
        #     color = [math.floor(c[0] * 255), math.floor(c[1] * 255), math.floor(c[2] * 255)]

        return color



M = Map()

while True:
    for event in pygame.event.get():
        if event.type == QUIT:
            pygame.quit()
            sys.exit()
    M.update()

    DISPLAYSURF.fill(WHITE)
    M.draw(DISPLAYSURF)

    pygame.display.update()
    FramePerSec.tick(FPS)
